import SHOPEE from '../WebCrawler/shopee';


const SHOPEE4 = async(name, page, searchType) => {
    let prdsList = [];
    try {
        for (let i = 0; i < 4; i++) {
            await SHOPEE(prdName, page, searchType, (products) => {
                prdsList = [...prdsList, ...products];
                console.log(prdsList);
            });
        }
        return prdsList;
    } 
    catch (err) {
        return [];
    }
}


export default SHOPEE4;

