import SHOPEE from '../WebCrawler/shopee';


const SHOPEE4 = async(name, page, searchType, callback) => {
    let prdsList = [];
    try {
        for (let i = 0; i < 4; i++) {
            await SHOPEE(name, parseInt(4*(page-1))+i, searchType, (products) => {
                prdsList = [...prdsList, ...products];
                console.log(prdsList.length);
            });
        }
        callback(prdsList);
    } 
    catch (err) {
        callback([]);
    }
}


export default SHOPEE4;

